// creates the square boxes that link to a given page using semantic-ui styling 

// imports 
import React from 'react';
import { Grid, Icon, Input, Menu } from "semantic-ui-react";

const HomePageGrid = () => {
    return (
        <div className="home-grid">

            <Menu.Item>
                <Input icon='search' placeholder='Search joke...' />
            </Menu.Item>

            <Grid>
                <Grid.Column>
                    <Icon name='book' />
                    JokeBook
                </Grid.Column>

                <Grid.Column>
                    <Icon name='id card' />
                    Public Feed 
                </Grid.Column>

                <Grid.Column>
                    <Icon name='star' />
                    Favorites
                </Grid.Column>

                <Grid.Column>
                    <Icon name='users' />
                    Friends 
                </Grid.Column>

                {/* <Grid.Column>
                    <Icon name='inbox' />
                    Inbox
                </Grid.Column> */}

                <Grid.Column>
                    <Icon name='user outline' />
                    Profile
                </Grid.Column>
            </Grid>

        </div>
    );   
};

export default HomePageGrid;
